import React from 'react';
import { connect } from 'react-redux';
import CollectionItem from '../../components/collection-item/collection-item.component';
import './category.style.scss';
import selectCollections from '../../redux/shop/shop.selector';

const CollectionPage = ({ match }) => {
  const collection = match.param.collectionID;
  console.log('match', match.params.collectionID);
  return (
    <div className="collection-page">

      <h2>
        KKKK page
        {' '}
        {/* {category} */}
      </h2>
    </div>
  );
};

const mapStateToProps = (state, ownProps) => ({
  collection: selectCollections(ownProps.match.params.collectionID)(state), // this is necessary because unlike otherselectors, this selector needs a part of the state depending on the url parameter
});

export default connect(mapStateToProps)(CollectionPage);
